import React from 'react';
import { View, Text, FlatList } from 'react-native';
import repositories from '../data/repositories.js';

const Repositories = () => {
    return (
        <FlatList
            data={repositories}
            renderItem={({item: repo}) => (
                <View>

                <Text>
                {repo.id}
            </Text>
            <Text>
                {repo.fullName}
            </Text>
                </View>
            )}
        >
        </FlatList>
    );
};

export default Repositories;
